import Favs from "./Routes/Favs";
import Detail from "./Routes/Detail";
import Contact from "./Routes/Contact";

function App() {
  return (
      <div className="App">
          <Navbar/>
          {/* <Routes>
            <Route path='/' element={<App/>} />
            <Route path='/home' element={<Home/>} />
